import React from "react";
import Header from "./components/header/Header";

import Home from "./components/home/Home";

import Tours from "./components/tours/Tours";

import Footer from "./components/footer/Footer";


function App() {
  return (
    <div>
      <Header></Header>
      <hr />
      <Home></Home>
      <hr />
      <Footer/>
    </div>
  )
}

export default App;
